import React from 'react';
import Page from '../Page';

class ProductPage extends React.Component{
    render(){
        const _content = [];
        _content.push(
            <div>Product page</div>
        );
        return (
        <div>
            <Page content={_content}></Page>
        </div>
        );
    }
}

export default ProductPage;
